import React, { Component } from 'react';
import {NavLink} from "react-router-dom";

import CssBaseline from '@material-ui/core/CssBaseline';
import Divider from '@material-ui/core/Divider';
import Drawer from '@material-ui/core/Drawer';
import Hidden from '@material-ui/core/Hidden';
import IconButton from '@material-ui/core/IconButton';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import MailIcon from '@material-ui/icons/Mail';
import MenuIcon from '@material-ui/icons/Menu';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles, useTheme } from '@material-ui/core/styles';

const drawerWidth = 270;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  drawer: {
    [theme.breakpoints.up('sm')]: {
      width: drawerWidth,
      flexShrink: 0,
    },
  },
  appBar: {
    [theme.breakpoints.up('sm')]: {
      width: `calc(100% - ${drawerWidth}px)`,
      marginLeft: drawerWidth,
    },
  },
 
  menuButton: {
    marginRight: theme.spacing(2),
    [theme.breakpoints.up('sm')]: {
      display: 'none',
      color: 'red'
    },
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  drawerPaper: {
    width: drawerWidth,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

class Paginate extends Component {

    state = {
        mobileOpen: false,
    }

    handleDrawerToggle = () => {
        this.setState({mobileOpen: !this.state.mobileOpen});
    };

    render() { 
        const container = window !== undefined ? () => window.document.body : undefined;
        const selectedId = window.location.pathname.substr(6);
   
        const classesActive1 = selectedId === "admin/profile" ? {activeColor: '#aeb2b2', color: '#202833'} : {activeColor: '', color: ''};
        const classesActive2 = selectedId === "admin/products" ? {activeColor: '#aeb2b2', color: '#202833'} : {activeColor: '', color: ''};
        const classesActive3 = selectedId === "admin/users" ? {activeColor: '#aeb2b2', color: '#202833'} : {activeColor: '', color: ''};
        const classesActive4 = selectedId === "admin/newproduct" ? {activeColor: '#aeb2b2', color: '#202833'} : {activeColor: '', color: ''};
        // const classesActive5 = selectedId === "vendor/earning" ? {activeColor: '#aeb2b2', color: '#202833'} : {activeColor: '', color: ''};
        

        return ( 
            <div className={classes.root}>
                <ButtonGroup color="primary" aria-label="outlined primary button group">
                <Button onClick={()=> filterOrder('pending')}  variant={pending}>Pending</Button>
                <Button onClick={()=> filterOrder('processed')} variant={processed} >Processed</Button>
                <Button onClick={()=> filterOrder('shipped')} variant={shipped} >Shipped</Button>
                <Button onClick={()=> filterOrder('delivered')} variant={delivered} >Delivered</Button>
                </ButtonGroup>
            </div>
         );
    }
}
 
export default Paginate;
